import React, { useState } from "react";
import "./App.css";

function App() {
  const [tripData, setTripData] = useState({
    name: "",
    from_city: "",
    destination_country: "",
    start_date: "",
    duration_days: "",
    budget_inr: "",
    interests: "",
  });
  const [plan, setPlan] = useState(null);
  const [loading, setLoading] = useState(false);
  const [darkMode, setDarkMode] = useState(false);

  const handleChange = (e) =>
    setTripData({ ...tripData, [e.target.name]: e.target.value });

  const toggleTheme = () => {
    document.body.classList.toggle("dark-mode");
    setDarkMode((d) => !d);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setPlan(null);

    try {
      const res = await fetch("http://localhost:8000/plan_trip", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({
          ...tripData,
          interests: tripData.interests
            .split(",")
            .map((i) => i.trim())
            .filter((i) => i),
        }),
      });
      if (!res.ok) throw new Error(res.statusText);
      const data = await res.json();
      setPlan(data.plan);
    } catch (err) {
      alert("Could not fetch plan. Please try again.");
    } finally {
      setLoading(false);
    }
  };

  // Convert the raw itinerary text into HTML paragraphs:
  //   **Day 1 (July 19):** ‚Ä¶ **Day 2 (July 20):** ‚Ä¶
  const formattedItinerary = plan
    ? plan.itinerary
        // wrap each **Day‚Ä¶:** in its own <p><strong>Day‚Ä¶:</strong>‚Ä¶</p>
        .replace(
          /\*\*(Day\s*\d+.*?):\*\*/g,
          "<p><strong>$1:</strong>"
        )
        // close each paragraph before the next Day or at the end
        .replace(/(?=<p><strong>Day|\s*$)/g, "</p>")
    : "";

  return (
    <div className="App">
      <nav className="navbar">
        <h1 className="logo">‚úàÔ∏è AI Trip Planner</h1>
        <button className="toggle" onClick={toggleTheme}>
          {darkMode ? "üåû" : "üåô"}
        </button>
      </nav>

      <header className="hero">
        <h1>üåè Plan Your Dream Trip</h1>
        <p>Let AI craft your perfect adventure</p>
      </header>

      <form className="form" onSubmit={handleSubmit}>
        {Object.entries(tripData).map(([k, v]) => (
          <input
            key={k}
            name={k}
            type={k.includes("date") ? "date" : "text"}
            value={v}
            placeholder={k.replace(/_/g, " ")}
            onChange={handleChange}
            required
          />
        ))}
        <button type="submit" disabled={loading}>
          {loading ? "Planning..." : "üìç Plan My Trip"}
        </button>
      </form>

      {loading && <p className="loading">‚è≥ Planning your dream trip...</p>}

      {plan && (
        <div className="plan-output">
          <h2 className="section-title">üß≥ Your AI Trip Plan</h2>

          <div className="section">
            <h3>üõ´ Flights</h3>
            <div className="card">{plan.flights}</div>
          </div>

          <div className="section">
            <h3>üè® Hotels</h3>
            <div className="card">{plan.hotels}</div>
          </div>

          <div className="section">
            <h3>üóìÔ∏è Itinerary</h3>
            <div
              className="card"
              dangerouslySetInnerHTML={{ __html: formattedItinerary }}
            />
          </div>

          <div className="section">
            <h3>üõÇ Visa Info</h3>
            <div className="card">{plan.visa}</div>
          </div>
        </div>
      )}

      <footer className="footer">
        üöÄ Built with üíô by your AI Travel Agent
      </footer>
    </div>
  );
}

export default App;
